import{login}from"../../services/auth.service.js";const loginForm=document.getElementById("login-form"),loginFormButton=document.getElementById("login-form-button");loginFormButton.addEventListener("click",e=>{e.preventDefault();var e=document.getElementById("user-email"),o=document.getElementById("user-password"),e={email:null==e?void 0:e.value,password:null==o?void 0:o.value};login("/login",e).then(e=>{localStorage.setItem("token",null==e?void 0:e.token),loginForm.submit()}).catch(e=>{console.error("Error login "+e)})});